import React from 'react';
import Footer from '../Footer';
import Menu from '../Menu';
import { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';



const Parts_stock_in = () => {

    const [partsName, setpartsName] = useState([]);
    const [parts, setparts] = useState([]);
    const navigate = useNavigate();
    const [id, setid] = useState('');
    const [price, setprice] = useState('');
    const [qty, setqty] = useState('');
    const [date, setdate] = useState('');
    const [msg, setmsg] = useState('');



    const getdata = () => {
        axios({
            method: 'get',
            url: 'http://localhost/fleet_manage/backend/Partsin/get_parts',
            responseType: 'json'
        }).then(function (response) {
            setparts(response.data.list)
            // console.log(response.data.list)

        });
    }

    const getpartsName = () => {
        axios({
            method: 'get',
            url: 'http://localhost/fleet_manage/backend/Partsin/get_partsName',
            responseType: 'json'
        }).then(function (response) {
            setpartsName(response.data.Namelist)
            // console.log(response.data.Namelist);
        });
    }
    useEffect(() => {
        getdata();
        getpartsName();
    }, []);


    const save = () => {

        axios.post('http://localhost/fleet_manage/backend/Partsin/get_stock_in', {

            parts_id: id,
            price: price,
            qty: qty,
            purchase_date: date

        }, {
            headers: {
                'Content-Type': 'application/json',
                'Authorization': localStorage.getItem('token')
            }
        }).then(function (response) {
            let data = response.data;
            setmsg(data.msg);
            setid('');
            setprice('');
            setqty('');
            setdate('');
            getdata();
            // console.log(data);
        })
    }

    const editParts = (id) => {
        navigate('/editPartsin/' + id);

    }

    const deleteParts = (d) => {
        axios.post('http://localhost/fleet_manage/backend/Partsin/deleteGet_stock_in', {
            id: d
        }, {
            headers: {
                'Content-Type': 'application/json',
                'Authorization': localStorage.getItem('token')
            }
        }).then(function (response) {
            let data = response.data;
            setmsg(data.msg);
            getdata();
        })
    }


    // const deleteuser = (id) => {
    //     axios.post('http://localhost/fleet_manage/backend/User/deleteuser', {
    //         id: id
    //     }, {
    //         headers: {
    //             'Content-Type': 'application/json',
    //             'Authorization': localStorage.getItem('token')
    //         }
    //     }).then(function (response) {
    //         let data = response.data;
    //         setmsg(data.msg)
    //         getdata()
    //     })
    // }


    return (
        <div className="hold-transition sidebar-mini">
            <div className="wrapper">
                <Menu />
                <div className="content-wrapper">
                    <div className="content-header">
                        <div className="container-fluid">
                            <div className="row mb-2">
                                <div className="col-sm-6">
                                    <h1 className="m-0">Parts Stock in</h1>

                                </div>
                                <div className="col-sm-6">
                                    <ol className="breadcrumb float-sm-right">
                                        <li className="breadcrumb-item"><a href="#">Home</a></li>
                                        <li className="breadcrumb-item active">Stock in</li>
                                    </ol>
                                </div>
                            </div>
                        </div>
                    </div>

                    <div className="content">
                        <div className="container-fluid">
                            <div className="row">

                                <div className="col-lg-10">
                                    <div className="card card-primary card-outline">
                                        <div className="card-header">
                                            <h4 className='m-0'>{msg}</h4>
                                        </div>
                                        <div className="card-body">
                                            {/* <h4>{msg}</h4> */}
                                            <table className='table table-bordered'>
                                                <tbody>
                                                    <tr>

                                                        <th>Select item</th>
                                                        <td>
                                                            <select className="form-control" onChange={(e) => setid(e.target.value)} value={id}>
                                                                <option value="">Select Parts</option>
                                                                {partsName.map((d, i) =>
                                                                    <option value={`${d.id}`} key={i}>{d.name}</option>
                                                                )}
                                                            </select>
                                                        </td>
                                                    </tr>
                                                    <tr>
                                                        <th>Price</th>
                                                        <td><input type='text' className='form-control' onChange={(e) => setprice(e.target.value)} value={price} /></td>
                                                    </tr>
                                                    <tr>
                                                        <th>Quantity</th>
                                                        <td><input type='text' className='form-control' onChange={(e) => setqty(e.target.value)} value={qty} /></td>
                                                    </tr>
                                                    <tr>
                                                        <th>Date</th>
                                                        <td><input type='date' className='form-control' onChange={(e) => setdate(e.target.value)} value={date} /></td>
                                                    </tr>
                                                    <tr>
                                                        <td colSpan={2}><input type='submit' className='btn btn-block btn-primary' value="Save" onClick={save} /></td>
                                                    </tr>
                                                </tbody>
                                            </table>

                                        </div>
                                    </div>
                                </div>

                                <div className="col-lg-12">
                                    <div className="card card-primary card-outline">
                                        <div className="card-header">
                                            <h5 className="m-0">List</h5>
                                        </div>
                                        <div className="card-body">
                                            <table className='table table-striped table-bordered table-hover'>
                                                <thead>
                                                    <tr>
                                                        <th>SL</th>
                                                        <th>Name</th>
                                                        <th>Price</th>
                                                        <th>Quantity</th>
                                                        <th>Stock_in Date</th>
                                                        <th>Action</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    {parts.map((d, i) =>
                                                        <tr key={i}>
                                                            <td>{i + 1}</td>
                                                            <td>{d.name}</td>
                                                            <td>{d.price}</td>
                                                            <td>{d.qty}</td>
                                                            <td>{d.purchase_date}</td>
                                                            <td>
                                                                <button onClick={() => editParts(d.id)} className='btn btn-primary'>Edit</button>
                                                                <button onClick={() => deleteParts(d.id)} className='btn btn-danger'>Delete</button>
                                                            </td>
                                                        </tr>
                                                    )}
                                                </tbody>
                                            </table>

                                        </div>
                                    </div>
                                </div>

                            </div>

                        </div>
                    </div>

                </div>


                <Footer />
            </div>
        </div>
    );
}

export default Parts_stock_in;
